import React from 'react'
import Card from "./App";
import Array from "./Array";

function Amazon (){
    return (<Card
    key={Array[1].id}
    img={Array[1].img}
    title={Array[1].title}
    span={Array[1].span}
    ankar={Array[1].ankar}
  />)
}

export default Amazon;
